import React from 'react';
import Select from 'react-select';

const options = [
    {
        label: 'MALE',
        value: 'MALE'
    },
    {
        label: 'Female',
        value: 'Female'
    },
    {
        label: 'NIGGA',
        value: 'NIGGA'
    },
    {
        label: 'NOT_SPECIFIED',
        value: 'NOT_SPECIFIED'
    }
]

function Dropdown(props) {
    return (
        <div>
            <Select options={options} />
        </div>
    )
}

export default Dropdown;
